import React from 'react'


function Online_Modal(props) {
    console.log(JSON.stringify(props));
    return (
        <div>
            <div>Task_Description: {props.data.Description}</div>
            <img src={props.data.Image}style={{ width: '100px', height: '100px' }}/>
            <div>Task_Date: {props.data.Date}</div>
            <div>Payment_Type: {props.data.Payment_type}</div>
            <div>Budget: ${props.data.Budget}</div>
        </div>

    )
}

export default Online_Modal
